import React, { useState } from 'react';
import CotizacionForm from '../components/CotizacionForm';
import TablaCotizaciones from '../components/TablaCotizaciones';

function CotizacionesContainer() {
  const [cotizaciones, setCotizaciones] = useState([]);
  const [cliente, setCliente] = useState(''); // Define cliente aquí

  return (
    <div>
      <CotizacionForm setCotizaciones={setCotizaciones} setCliente={setCliente} /> {/* Pasar setCliente como prop al CotizacionForm */}
      <TablaCotizaciones cotizaciones={cotizaciones} cliente={cliente} /> {/* Pasar cliente como prop al TablaCotizaciones */}
    </div>
  );
}

export default CotizacionesContainer;
